INSERT INTO "products" VALUES(38,'Kit Gallery Elegance + Body Cream One Touch Silk + Heaven Blue - Wepink',replace('O Kit de Desodorantes Colônia Body Splash Wepink Gallery Elegance é uma coleção exclusiva que transforma cada momento do dia em uma experiência de sofisticação. Com quatro fragrâncias únicas e cuidadosamente selecionadas, ele combina frescor, doçura, leveza e sedução em borrifadas que despertam os sentidos e celebram a sua singularidade e elegância.\n\nA Loção Desodorante Body Cream Wepink Heaven Blue é ideal para deixar sua pele hidratada, nutrida e firme, graças à sua composição que tem uma fórmula especial para auxiliar na produção de colágeno e na regeneração celular. Além disso, seu mix de óleos e extratos deixam sua pele com um aspecto sempre saudável e brilhoso.\n\nReceba a hidratação que você merece com a Loção Desodorante Body Cream Wepink One Touch Silk, elaborada cuidadosamente para que sua composição forneça auxílio na produção de colágeno e regeneração celular, deixando assim sua pele saudável e brilhosa o tempo todo. Tudo fica melhor ainda com a sua pele perfumada por um mix maravilhoso de flores e frutas, para ficar com aquela sensação de frescor o dia inteiro.','\n',char(10)),149.9,552.8,'https://wepink.vtexassets.com/arquivos/ids/163627-700-700?v=639048929942430000&width=700&height=700&aspect=true',37,0,1,100,'2026-01-27 23:42:41','2026-01-28 00:43:57');
INSERT INTO "products" VALUES(39,'Kit Gallery Elegance Edição Limitada – Wepink',replace('O Kit de Desodorantes Colônia Body Splash Wepink Gallery Elegance é uma coleção exclusiva que transforma cada momento do dia em uma experiência de sofisticação. Com quatro fragrâncias únicas e cuidadosamente selecionadas, ele combina frescor, doçura, leveza e sedução em borrifadas que despertam os sentidos e celebram a sua singularidade e elegância.\n\nCLARET\nO Desodorante Colônia Body Splash Wepink Gallery Elegance Claret é a doce indulgência da sedução em um aroma todo especial. Suas notas selecionadas acendem a faísca de uma paixão viciante que irá chacoalhar a sua rotina da melhor forma, deixando um rastro hipnotizante em seu caminho.\n\nCaminho olfativo: Gourmand Oriental.\nNotas de saída: Rum, Pimenta Rosa e Acorde de Frutas Amarelas.\nNotas de corpo: Mel, Rosa e Patchouli.\nNotas de fundo: Benjoim, Baunilha, Cumarina e Âmbar.\n\nNAVAJO\nO Desodorante Colônia Body Splash Wepink Gallery Elegance Navajo conquista a força revitalizante do sol para entregar uma fragrância leve e despretensiosa, mas que proporciona sorrisos da maior magnitude. É como se balançar vagarosamente em uma rede, aproveitando o ar do litoral.\n\nCaminho olfativo: Solar Vibrante.\nNotas de saída: Mandarina, Manga e Notas Ozônicas.\nNotas de corpo: Solar, Violeta e Jasmim.\nNotas de fundo: Baunilha, Benjoim e Caramelo.\n\nPHLOX\nO Desodorante Colônia Body Splash Wepink Gallery Elegance Phlox é em sua essência como uma manhã fria de outono, que logo é aquecida pela luz radiante do sol. Seu aroma floral traz um doce reconfortante que carrega em si uma sensação saudosa de bons momentos que já foram, e a esperança dos que ainda virão.\n\nCaminho olfativo: Solar Vibrante.\nNotas de saída: Ameixa, Orquídea e Lírio-do-Vale.\nNotas de corpo: Violetas, Amêndoas e Açúcar.\nNotas de fundo: Baunilha, Sândalo e Âmbar.\n\nTYRIAN\nAguçe sua curiosidade com o Desodorante Colônia Body Splash Wepink Gallery Elegance Tyrian, que vem com uma fragrância de frescor intrigante, repleta de qualidade e sofisticação. Suas notas se combinam para um aroma especial, perfeito para ativar os seus sentidos.\n\nCaminho olfativo: Oriental Especiado.\nNotas de saída: Papiro e Cardamomo.\nNotas de corpo: Violeta e Íris.\nNotas de fundo: Cedro, Âmbar, Couro e Sândalo.','\n',char(10)),109.9,337,'https://wepink.vtexassets.com/arquivos/ids/163619-700-700?v=639048483558200000&width=700&height=700&aspect=true',37,0,1,100,'2026-01-28 00:45:14','2026-01-28 00:45:14');
INSERT INTO "products" VALUES(40,'Kit Shampoo + Condicionador + Leave-in + Booster - Wepink',replace('O Shampoo Wepink My Hair Ultra Repair é o primeiro passo para conquistar fios brilhantes e saudáveis todos os dias. Ele limpa com suavidade enquanto entrega hidratação intensa, brilho e maciez graças aos extratos de aloe vera e chá verde.\nSua fórmula poderosa age da raiz às pontas, reparando danos, reduzindo pontas duplas e fortalecendo até os cabelos quimicamente tratados. Com tecnologia avançada de hiper proteína e complexo reticulante, ajuda no crescimento saudável, combate a queda e protege contra novos danos.\nE para completar, tem um toque refrescante que deixa aquela sensação deliciosa de frescor, com fios macios, soltinhos e perfumados o dia todo.\n\nO Condicionador Wepink My Hair Ultra Repair é o aliado perfeito para deixar seus fios alinhados, macios e com um brilho incrível. Ele desembaraça fácil, hidrata profundamente e devolve força e elasticidade graças ao D-Pantenol, ao extrato natural de groselha indiana e aos óleos vegetais de abacate, camélia e chá verde.\nCom uma tecnologia pensada para cabelos quimicamente tratados, ele combina lanolina, hiper proteína, complexo reticulante e um blend vegetal poderoso que cria uma película protetora, controla o frizz, reduz pontas duplas e repara as áreas mais danificadas da fibra capilar. O resultado? Fios mais saudáveis, sedosos e protegidos, com um toque perfumado que dura o dia inteiro.\n\nO Booster Repair foi desenvolvido para revolucionar o jeito de cuidar do seu cabelo. Ele não é um simples “reparador de pontas” ou “óleo de cabelo".\nÉ a fórmula exclusiva que faltava para uma restauração completa dos fios, hidratação da raiz até as pontas trazendo brilho e maciez ao cabelo, além de deixar o cabelo perfumado.\nAlém de todos os ativos e benefícios incríveis, ele tem uma finalização indescritível e um cheiro fora do normal, o verdadeiro perfume para o cabelo.\n\nExperimente a sensação de cabelo perfeito a cada splash com o Leave-in Capilar Multifuncional do mundo rosa! O tratamento vai redefinir os seus cuidados capilares, oferecendo praticidade incomparável e um resultado final perfeito!\nO Leave-in é essencial para manter o cabelo saudável e forte. Seu tratamento instantâneo sem enxágue, tem a combinação de ativos especialmente selecionados, que aumentam a resistência, fortalecem os fios, reparam danos causados pelo calor, sela as pontas duplas e proporciona mais brilho, maciez e hidratação.\n\nVersátil, o Leave-in permite aplicação tanto no cabelo seco para dar um efeito finalizador, quanto com o cabelo úmido, oferecendo uma camada de proteção térmica. O seu cabelo ficará lindo e leve, do jeito que você mais adora!','\n',char(10)),132.9,523.6,'https://wepink.vtexassets.com/arquivos/ids/163615-1200-auto?v=639045013809100000&width=1200&height=auto&aspect=true',37,0,1,100,'2026-01-28 00:46:01','2026-01-28 00:46:01');
INSERT INTO "products" VALUES(41,'Kit Proteína + Máscara + Hair Mist Heaven - Wepink',replace('A Proteína Capilar Wepink My Hair Ultra Repair é a sua maior aliada para conquistar fios sedosos e incríveis, agregando hidratação profunda, elasticidade, maciez e brilho com seus potentes ativos de D-Pantenol, lanolina e um mix natural dos óleos vegetais, argan e chá verde. Sua composição repara da raiz às pontas em um cuidado capilar essencial, por meio do melhor blend da proteína hidrolisada do trigo, arroz e a lanolina, restaurando a fibra danificada, reduzindo o frizz e promovendo ação antioxidante e nutritiva, além de melhorar a resistência capilar e proporcionar um crescimento saudável aos fios. Tudo isso, combinado em uma fragrância potente para o dia a dia, mantendo seu cabelo macio e perfumado durante o dia todo.\n\nO Desodorante Capilar Hair Mist Wepink Heaven é o melhor para cabelos mais brilhantes, protegidos e perfumados durante o dia todo, em uma essência que remete a um universo delicado e alegre. Seu aroma ascende a um verdadeiro paraíso em um mix de flores, levando a uma jornada deslumbrante na Mandarina e na Flor de Laranjeira. Finaliza em um fundo doce, amadeirado e elegante.\n\nA Máscara Capilar Wepink My Hair Ultra Repair foi feita para devolver vida, força e beleza aos cabelos. Com um mix poderoso de óleos vegetais, hiperproteína, lanolina e ácido poliglutâmico, ela hidrata profundamente, nutre e repara os fios da raiz às pontas. Sua fórmula cria uma película protetora que mantém a hidratação, reduz o frizz, recupera pontas duplas e fortalece o bulbo capilar, ajudando no crescimento saudável. O extrato de linhaça e de sálvia potencializa o volume e a resistência, enquanto o D-Pantenol, extrato de groselha indiana e a aloe vera deixam os fios mais elásticos, macios e brilhantes. Resultado: cabelo saudável, encorpado e com aquele toque sedoso que você sente e vê.\n\n','\n',char(10)),99.9,472.7,'https://wepink.vtexassets.com/arquivos/ids/163628-700-700?v=639051092790100000&width=700&height=700&aspect=true',37,0,1,100,'2026-01-28 00:48:55','2026-01-28 00:48:55');
INSERT INTO "products" VALUES(42,'Kit We Femme + Myskin Body + Cleanser - Wepink',replace('O Sabonete Íntimo Wepink We Femme é formulado com ativos que promovem uma limpeza suave para a região íntima, sem deixar de lado a hidratação, conforto e uma agradável sensação para o dia a dia. Sua composição é livre de parabenos, além de prevenir irritações, manter a saúde e bem-estar da região, em uma textura leve e perfeita para um cuidado saudável.\n\nO Gel Antiacne Corporal Myskin Body é formulado com ativos que promovem uma esfoliação química suave, oferecem hidratação, controlam a oleosidade e contribuem para a uniformização do tom da pele. Tudo isso, com uma essência única para deixar sua pele perfumada durante o uso.\n\nO Sabonete Facial Essencial Cleanser foi desenvolvido para completar com excelência o seu jeito de se cuidar. Criamos uma fórmula exclusiva para todos os tipos de pele que traz uma limpeza profunda com alto poder adstringente e um tônico natural para seu rosto.','\n',char(10)),89.9,370.9,'https://wepink.vtexassets.com/arquivos/ids/163614-1200-auto?v=639045012573570000&width=1200&height=auto&aspect=true',37,0,1,100,'2026-01-28 00:49:54','2026-01-28 00:49:54');
INSERT INTO "products" VALUES(43,'Kit Myskin + Sérum 10 em 1 + Protetor Solar - Wepink',replace('A espuma esfoliante da wepink veio para complementar a sua rotina de skincare, ela não é somente uma espuma de limpeza profunda, com uma super composição vai auxiliar sua pele na hidratação, uniformização do tom e no combate ao envelhecimento precoce.\n\nO Sérum Facial 10 em 1 Wepink foi desenvolvido para ser o seu produto único e essencial, tudo o que você precisa para sua pele em um único sérum.\n\nSuncare, o protetor solar facial do mundo rosa foi desenvolvido para hidratar, equilibrar e oferece alta proteção para a pele, combatendo os efeitos nocivos dos raios UVA/UVB. Com um PPD (Dose de Pigmentação Persistente) de 18,5 e FPS 50 contra UVB, sua fórmula única é enriquecida com ativos inteligentes, que não apenas defendem dos raios solares, mas também auxiliam na prevenção de acnes, no controle da oleosidade e combate ao envelhecimento precoce.\n\n','\n',char(10)),99.9,589.7,'https://wepink.vtexassets.com/arquivos/ids/163613-1200-auto?v=639045011711770000&width=1200&height=auto&aspect=true',37,0,1,100,'2026-01-28 00:50:28','2026-01-28 00:52:09');
INSERT INTO "products" VALUES(44,'Body Scrub Obsessed Esfoliante Corporal 450gr - Wepink','O Esfoliante Corporal Body Scrub Wepink Obsessed aprecia a mulher festiva, sexy e desejada, sendo cuidadosamente formulado em um caminho olfativo amadeirado. Sua composição possui ativos que promovem esfoliação suave e hidratação, refletindo elegância e sensualidade. Tudo isso, em notas marcantes de Laranja Sanguínea e Gardênia, para deixar sua pele macia, saudável e perfumada durante o dia todo. Finaliza em um fundo envolvente de mel e caramelo, um deleite despretensioso aos sentidos.',52.9,139.9,'https://wepink.vtexassets.com/arquivos/ids/163350-500-500?v=639005428568570000&width=500&height=500&aspect=true',38,0,1,100,'2026-01-28 22:31:35','2026-01-28 22:33:02');
INSERT INTO "products" VALUES(45,'Body Scrub VF Golden Esfoliante Corporal 450gr - Wepink',replace('O Body Scrub VF Golden é puro luxo em forma de cuidado. Um esfoliante que vai muito além do básico: ele renova profundamente, hidrata de verdade e deixa sua pele tão macia que é impossível não se apaixonar pelo toque.\n\nCom Aloe Vera, Óleo de Amêndoas e Óleo de Rosa Mosqueta, ele nutre, regenera e devolve a firmeza natural da pele. E para completar, perfuma com uma fragrância irresistível que envolve e conquista, transformando seu momento de autocuidado em algo inesquecível.','\n',char(10)),52.9,139.9,'https://wepink.vtexassets.com/arquivos/ids/163111-500-500?v=638996798192330000&width=500&height=500&aspect=true',38,0,1,100,'2026-01-28 22:31:35','2026-01-28 22:33:09');
INSERT INTO "products" VALUES(46,'Myskin Essential Body 250ml - Wepink','O Gel Antiacne Corporal Myskin Body é formulado com ativos que promovem uma esfoliação química suave, oferecem hidratação, controlam a oleosidade e contribuem para a uniformização do tom da pele. Tudo isso, com uma essência única para deixar sua pele perfumada durante o uso.',44.9,169,'https://wepink.vtexassets.com/arquivos/ids/159902-500-500?v=638755052112300000&width=500&height=500&aspect=true',38,0,1,100,'2026-01-28 22:31:35','2026-01-28 22:33:21');
INSERT INTO "products" VALUES(47,'We Femme Sabonete Íntimo 250ml - Wepink','O Sabonete Íntimo Wepink We Femme é formulado com ativos que promovem uma limpeza suave para a região íntima, sem deixar de lado a hidratação, conforto e uma agradável sensação para o dia a dia. Sua composição é livre de parabenos, além de prevenir irritações, manter a saúde e bem-estar da região, em uma textura leve e perfeita para um cuidado saudável.',44.9,89.9,'https://wepink.vtexassets.com/arquivos/ids/159897-500-500?v=638755052548500000&width=500&height=500&aspect=true',38,0,1,100,'2026-01-28 22:31:36','2026-01-28 22:32:46');
